function trackUser() {
  var currentURL = window.location.pathname;
  var dateObj = new Date();
  var d = new Date();
  d.setTime(d.getTime()+(1*24*60*60*1000));
  var expires = "expires="+d.toGMTString();
  var userPathArr = [];
  var pathObj = {}
  var accessedTime = "Accessed: "+(dateObj.getMonth()+1)+'/'+dateObj.getDate()+'/'+dateObj.getFullYear()+' at '+dateObj.getHours()+':'+dateObj.getMinutes();
  pathObj.pageURL = currentURL;
  pathObj.access = accessedTime;
  userPathArr.push({"page": pathObj});

  var checkForCookie = read_cookie("userPath");
  if(!checkForCookie) {
    userPathArr.push({"page": pathObj});
  } else {
    userPathArr = checkForCookie;
    userPathArr.push({"page": pathObj});
  }
  var stringObject = JSON.stringify(userPathArr);
  document.cookie = "userPath="+stringObject+"; "+expires+'; path=/;';
  return false;
}

function read_cookie(name) {
   var result = document.cookie.match(new RegExp(name + '=([^;]+)'));
   result && (result = JSON.parse(result[1]));
   return result;
}

function removeIOSRubberEffect(element) {
  element.addEventListener('touchstart', function () {
    var top = element.scrollTop, totalScroll = element.scrollHeight, currentScroll = top + element.offsetHeight;

    if (top === 0) {
      element.scrollTop = 1;
    } else if (currentScroll === totalScroll) {
      element.scrollTop = top - 1;
    }
  });
}